  return (
    <div className={style.index}>
      <div>index</div>
      <div className={style.buttonBox}>
        <div>
          <button
            onClick={() => {
              setPage("input");
            }}
          >
            toInput
          </button>
        </div>
        <div>
          <button
            onClick={() => {
              setPage("output");
            }}
          >
            toOutdex
          </button>
        </div>
      </div>
    </div>
  );
};

export default Index;
